I would absolutely love to be in the Act now speak later Central Coast team for 2020, my name is Lucy Eggleton I am 12 years old and dance is my everything, ansl is such an amazing team of lovely people. Last year I attended the first central coast ansl workshop it was amazing to see so many amazing people all dancing for a cause and I would love to be even more involved with ansl this year. I see people everyday struggling with cancer and it would mean the world to me if I could help by doing the thing I love most.
@actnowspeaklater 
#ansl2020centralcoast
